<script lang="ts">
	export let name = '';
	export let cube = false;
	export let note = false;
	export let pencil = false;
	export let motorcycle = false;
	export let beer = false;
	export let diode = false;
	export let car = false;
	export let resistor = false;
	export let spades = false;
	export let coffee = false;
	export let laser = false;
	export let micrometer = false;
	export let thread = false;
	export let brush = false;
	export let dice = false;
	export let anvil = false;
	export let saw = false;
	export let code = false;
	export let console = false;
	export let printer = false;
	export let lightning = false;

	const updateBadgeIconsText = (
		cube: boolean,
		note: boolean,
		pencil: boolean,
		motorcycle: boolean,
		beer: boolean,
		diode: boolean,
		car: boolean,
		resistor: boolean,
		spades: boolean,
		coffee: boolean,
		laser: boolean,
		micrometer: boolean,
		thread: boolean,
		brush: boolean,
		dice: boolean,
		anvil: boolean,
		saw: boolean,
		code: boolean,
		console: boolean,
		printer: boolean,
		lightning: boolean
	) => {
		var badgeIconsText = '';
		if (cube) {
			badgeIconsText += '3';
		}
		if (note) {
			badgeIconsText += 'A';
		}
		if (pencil) {
			badgeIconsText += 'B';
		}
		if (motorcycle) {
			badgeIconsText += 'C';
		}
		if (beer) {
			badgeIconsText += 'D';
		}
		if (diode) {
			badgeIconsText += 'E';
		}
		if (car) {
			badgeIconsText += 'F';
		}
		if (resistor) {
			badgeIconsText += 'G';
		}
		if (spades) {
			badgeIconsText += 'J';
		}
		if (coffee) {
			badgeIconsText += 'K';
		}
		if (laser) {
			badgeIconsText += 'L';
		}
		if (micrometer) {
			badgeIconsText += 'M';
		}
		if (thread) {
			badgeIconsText += 'N';
		}
		if (brush) {
			badgeIconsText += 'P';
		}
		if (dice) {
			badgeIconsText += 'R';
		}
		if (anvil) {
			badgeIconsText += 'S';
		}
		if (saw) {
			badgeIconsText += 'T';
		}
		if (code) {
			badgeIconsText += 'U';
		}
		if (console) {
			badgeIconsText += 'V';
		}
		if (printer) {
			badgeIconsText += 'W';
		}
		if (lightning) {
			badgeIconsText += 'X';
		}

		return badgeIconsText;
	};

	$: badge_icons = updateBadgeIconsText(
		cube,
		note,
		pencil,
		motorcycle,
		beer,
		diode,
		car,
		resistor,
		spades,
		coffee,
		laser,
		micrometer,
		thread,
		brush,
		dice,
		anvil,
		saw,
		code,
		console,
		printer,
		lightning
	);
</script>

